custodhist.p:
Het archief is in verschillende fasen overgedragen van de registraties op de betrokken beleidsafdelingen naar het semi-statisch archief. Er is eerder uit dit archief vernietigd, maar de dossiers zijn nog niet eerder materieel bewerkt. Het archief is niet meer compleet omdat het al eerder vernietigd is op basis van oude vernietigingslijsten. De neerslag van de taken omtrent uitlevering is vermoedelijk wel compleet, aangezien er nog vele dossiers zijn overgebleven. De volgende vernietigingen hebben plaatsgevonden: 


EX: driemaal: in 1982 en 1983 (twee maal) uit de periode 1921-1958;


OS: viermaal: in 1982, 1983 en 2000 (twee maal) uit de periode 1967-1991;


RC: zevenmaal: in 1978, 1981, 1982, 1983, 1984, 2000 en 2001 uit de periode 1958-1991.

appraisal.p:
